import React from 'react'
import './App.css';
import HomePage from './components/homepage/homepage'
import { Route } from 'react-router-dom'

const HatsPage = () => {
  <div>
      <h1>Hats Page</h1>
  </div>
}

function App() {
  return (
    <div>
      <Route path='/hats' component={HatsPage} />
      <Route path='/' component={HomePage} />
    </div>
  );
}

export default App;
